import React from 'react';
import { Col } from 'react-bootstrap';

export default function Header(){
  return (
     <Col md="9" style={{backgroundColor:"#EFEFEF", height:"40px", marginTop:"0"}}>
      <p>this is the header</p>
     </Col>
  )

}
